def intersection(lst1, lst2):
    llst = []
    for i in lst1:
        if i in lst2 and llst.count(i) == 0:
            llst.append(i)
    print(len(llst))
    return llst


def union(lst1, lst2):
    llst = []
    for i in lst1:
        if llst.count(i) == 0:
            llst.append(i)
    for ij in lst2:
        if llst.count(ij) == 0:
            llst.append(ij)
    print(len(llst))
    return llst


